import React, { Component } from 'react';
import ObjectivesContent from '../ObjectivesContent/ObjectivesContent';
import UserDetails from '../UserDetails/UserDetails';
import axios from 'axios';

var objs = [];
var searchString = './api/objectives/' + cookies.get('userId');

axios.get(searchString).then(function(response) {
  objs = response.data.data;
});

class ObjectivesPage extends Component {

  render(){
    return(
      <div className = "profile-content container">
        <UserDetails 
        uName={this.props.uName}
        uPic={this.props.uPic}
        uEmail={this.props.uEmail}
        />
        <ObjectivesContent
          showModal={this.props.showModal}
          objectives={objs}
        />
      </div>
    );
  }
}

export default ObjectivesPage;
